import React from 'react';
import { connect } from 'react-redux';
import * as actions from '../../Redux/Actions/actions.js';

class SideBar extends React.PureComponent {
  render() {
    return (
      <>
        <p>Management menu</p>
        <div className="sideBar">
          <button
            className="sideBarItem"
            id="stuffPage"
            onClick={() => {
              this.props.getStaff();
            }}
          >
            Stuff
          </button>
          <button
            className="sideBarItem"
            id="clientsPage"
            onClick={() => {
              this.props.getClients();
            }}
          >
            Clients
          </button>
          <button
            className="sideBarItem"
            id="servicesPage"
            onClick={() => {
              this.props.getServices();
            }}
          >
            Services
          </button>
          <button
            className="sideBarItem"
            id="materialsPage"
            onClick={() => {
              this.props.getMaterials();
            }}
          >
            Materials
          </button>
          <button
            className="sideBarItem"
            id="ordersPage"
            onClick={() => {
              this.props.getOrders();
            }}
          >
            Orders
          </button>
          <button
            className="sideBarItem"
            id="schedulesPage"
            onClick={() => {
              this.props.getSchedules();
            }}
          >
            Schedules
          </button>
          <button
            className="sideBarItem"
            id="promoPage"
            onClick={() => {
              this.props.getPromos();
            }}
          >
            Promo
          </button>
          <button
            className="sideBarItem"
            id="profilesPage"
            onClick={() => {
              this.props.getProfiles();
            }}
          >
            Profiles
          </button>
          <button
            className="sideBarItem"
            id="galleryPage"
            onClick={() => {
              this.props.getgallery();
            }}
          >
            Gallery
          </button>
          <button
            className="sideBarItem"
            id="feedbacksPage"
            onClick={() => {
              this.props.getFeedbacks();
            }}
          >
            Feedbacks
          </button>
          <button
            className="sideBarItem"
            id="galleryPage"
            onClick={() => {
              this.props.getGallery();
            }}
          >
            Gallery
          </button>
        </div>
      </>
    );
  }
}

function mapStateToProps(state) {
  return {};
}

function mapDispatchToProps(dispatch) {
  return {
    getClients: (dispatch) => dispatch(actions.ClientsFeetchData()),
    getStaff: (dispatch) => dispatch(actions.StaffsFeetchData()),
    getMaterials: (dispatch) => dispatch(actions.MaterialsFeetchData()),
    getServices: (dispatch) => dispatch(actions.ServicesFeetchData()),
    getOrders: (dispatch) => dispatch(actions.OrdersFeetchData()),
    getSchedules: (dispatch) => dispatch(actions.SchedulesFeetchData()),
    getPromos: (dispatch) => dispatch(actions.PromosFeetchData()),
    getProfiles: (dispatch) => dispatch(actions.ProfilesFeetchData()),
    getFeedbacks: (dispatch) => dispatch(actions.FeedbacksFeetchData()),
    getGallery: (dispatch) => dispatch(actions.MediaFilesFeetchData()),
  };
}
export default connect(mapStateToProps, mapDispatchToProps)(SideBar);
